query ShopifyProducts {
  allShopifyProduct (limit: 6) {
    edges {
      node {
        id
        title
        handle
        availableForSale
        descriptionHtml
        priceRange {
          minVariantPrice {
            amount(format: true)
          }
        }
        images (limit: 1) {
          id
          altText
          src: transformedSrc (maxWidth: 400, maxHeight: 300, crop: CENTER)
        }
      }
    }
  }
}
